--
-- Name: cleanup_expired_enrichment_cache(); Type: FUNCTION; Schema: public; Owner: trader
--

CREATE FUNCTION public.cleanup_expired_enrichment_cache() RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    deleted_count INTEGER;
BEGIN
    DELETE FROM enrichment_cache 
    WHERE expires_at IS NOT NULL AND expires_at < CURRENT_TIMESTAMP;
    
    GET DIAGNOSTICS deleted_count = ROW_COUNT;
    RETURN deleted_count;
END;
$$;


ALTER FUNCTION public.cleanup_expired_enrichment_cache() OWNER TO trader;

