--
-- Name: cleanup_trade_jobs(); Type: FUNCTION; Schema: public; Owner: trader
--

CREATE FUNCTION public.cleanup_trade_jobs() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Delete jobs that reference the deleted trade
    DELETE FROM job_queue 
    WHERE data->>'tradeId' = OLD.id::text
    OR (data->'tradeIds' ? OLD.id::text);
    
    -- Log the cleanup for debugging
    RAISE NOTICE 'Cleaned up jobs for deleted trade %', OLD.id;
    
    RETURN OLD;
END;
$$;


ALTER FUNCTION public.cleanup_trade_jobs() OWNER TO trader;

--
-- Name: generate_anonymous_name(uuid); Type: FUNCTION; Schema: public; Owner: trader
--

CREATE FUNCTION public.generate_anonymous_name(user_id uuid) RETURNS character varying
    LANGUAGE plpgsql IMMUTABLE
    AS $$
DECLARE
  prefixes TEXT[] := ARRAY[
    'Shadow', 'Iron', 'Storm', 'Fire', 'Ice', 'Thunder', 'Lightning', 'Dark', 'Bright', 'Silent',
    'Swift', 'Mighty', 'Golden', 'Silver', 'Crimson', 'Azure', 'Emerald', 'Mystic', 'Phantom', 'Stealth',
    'Cyber', 'Neon', 'Quantum', 'Alpha', 'Beta', 'Omega', 'Prime', 'Ultra', 'Mega', 'Hyper',
    'Rogue', 'Elite', 'Savage', 'Wild', 'Fierce', 'Brutal', 'Rapid', 'Turbo', 'Blazing', 'Frozen',
    'Venom', 'Toxic', 'Nuclear', 'Laser', 'Plasma', 'Cosmic', 'Stellar', 'Solar', 'Lunar', 'Nova'
  ];
  
  suffixes TEXT[] := ARRAY[
    'Hunter', 'Wolf', 'Eagle', 'Hawk', 'Tiger', 'Lion', 'Bear', 'Fox', 'Viper', 'Falcon',
    'Warrior', 'Knight', 'Ranger', 'Scout', 'Sniper', 'Assassin', 'Guardian', 'Sentinel', 'Defender', 'Striker',
    'Blade', 'Arrow', 'Bullet', 'Bolt', 'Spike', 'Claw', 'Fang', 'Talon', 'Wing', 'Shield',
    'Storm', 'Blaze', 'Frost', 'Flame', 'Spark', 'Flash', 'Dash', 'Rush', 'Crush', 'Smash',
    'Force', 'Power', 'Might', 'Fury', 'Rage', 'Wrath', 'Steel', 'Stone', 'Rock', 'Crystal'
  ];
  
  hash_value INTEGER;
  prefix_index INTEGER;
  suffix_index INTEGER;
BEGIN
  -- Generate a consistent hash from user_id
  hash_value := abs(hashtext(user_id::text));
  
  -- Use hash to select prefix and suffix with different modulo operations for variety
  prefix_index := (hash_value % array_length(prefixes, 1)) + 1;
  suffix_index := ((hash_value / 13) % array_length(suffixes, 1)) + 1;
  
  -- Return combined username without spaces (like ShadowHunter, IronWolf, etc.)
  RETURN prefixes[prefix_index] || suffixes[suffix_index];
END;
$$;


ALTER FUNCTION public.generate_anonymous_name(user_id uuid) OWNER TO trader;

--
-- Name: generate_enrichment_cache_key(character varying, date, time without time zone); Type: FUNCTION; Schema: public; Owner: trader
--

CREATE FUNCTION public.generate_enrichment_cache_key(p_symbol character varying, p_entry_date date, p_entry_time time without time zone DEFAULT NULL::time without time zone) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF p_entry_time IS NOT NULL THEN
        RETURN LOWER(p_symbol) || '_' || TO_CHAR(p_entry_date, 'YYYY-MM-DD') || '_' || TO_CHAR(p_entry_time, 'HH24:MI');
    ELSE
        RETURN LOWER(p_symbol) || '_' || TO_CHAR(p_entry_date, 'YYYY-MM-DD');
    END IF;
END;
$$;


