--
-- Name: get_cusip_mapping(character varying, uuid); Type: FUNCTION; Schema: public; Owner: trader
--

CREATE FUNCTION public.get_cusip_mapping(p_cusip character varying, p_user_id uuid DEFAULT NULL::uuid) RETURNS TABLE(cusip character varying, ticker character varying, company_name character varying, resolution_source character varying, confidence_score integer, verified boolean, is_user_override boolean)
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- First try to find user-specific mapping
  IF p_user_id IS NOT NULL THEN
    RETURN QUERY
    SELECT 
      cm.cusip,
      cm.ticker,
      cm.company_name,
      cm.resolution_source,
      cm.confidence_score,
      cm.verified,
      TRUE as is_user_override
    FROM cusip_mappings cm
    WHERE cm.cusip = p_cusip 
      AND cm.user_id = p_user_id
    LIMIT 1;
    
    -- If user-specific mapping found, return it
    IF FOUND THEN
      RETURN;
    END IF;
  END IF;
  
  -- If no user-specific mapping, try global mapping
  RETURN QUERY
  SELECT 
    cm.cusip,
    cm.ticker,
    cm.company_name,
    cm.resolution_source,
    cm.confidence_score,
    cm.verified,
    FALSE as is_user_override
  FROM cusip_mappings cm
  WHERE cm.cusip = p_cusip 
    AND cm.user_id IS NULL
  ORDER BY cm.confidence_score DESC, cm.created_at ASC
  LIMIT 1;
END;
$$;


ALTER FUNCTION public.get_cusip_mapping(p_cusip character varying, p_user_id uuid) OWNER TO trader;

--
-- Name: get_or_create_global_enrichment_cache(character varying, date); Type: FUNCTION; Schema: public; Owner: trader
--

CREATE FUNCTION public.get_or_create_global_enrichment_cache(p_symbol character varying, p_trade_date date) RETURNS uuid
    LANGUAGE plpgsql
    AS $$
DECLARE
    cache_id UUID;
BEGIN
    -- Try to find existing cache entry
    SELECT id INTO cache_id
    FROM global_enrichment_cache
    WHERE symbol = p_symbol AND trade_date = p_trade_date;
    
    -- If not found, create new entry
    IF cache_id IS NULL THEN
        INSERT INTO global_enrichment_cache (symbol, trade_date)
        VALUES (p_symbol, p_trade_date)
        RETURNING id INTO cache_id;
    ELSE
        -- Update access tracking
        UPDATE global_enrichment_cache
        SET access_count = access_count + 1,
            last_accessed_at = CURRENT_TIMESTAMP
        WHERE id = cache_id;
    END IF;
    
    RETURN cache_id;
END;
$$;


ALTER FUNCTION public.get_or_create_global_enrichment_cache(p_symbol character varying, p_trade_date date) OWNER TO trader;

--
-- Name: get_or_create_news_cache(character varying, date, jsonb, character varying); Type: FUNCTION; Schema: public; Owner: trader
--

CREATE FUNCTION public.get_or_create_news_cache(p_symbol character varying, p_news_date date, p_news_events jsonb DEFAULT '[]'::jsonb, p_sentiment character varying DEFAULT NULL::character varying) RETURNS TABLE(cache_id uuid, news_events jsonb, sentiment character varying, was_cached boolean)
    LANGUAGE plpgsql
    AS $$
DECLARE
    existing_record news_cache%ROWTYPE;
    new_record news_cache%ROWTYPE;
BEGIN
    -- Try to find existing cache entry
    SELECT * INTO existing_record 
    FROM news_cache 
    WHERE symbol = p_symbol AND news_date = p_news_date;
    
    IF FOUND THEN
        -- Return existing cached data
        RETURN QUERY SELECT 
            existing_record.id,
            existing_record.news_events,
            existing_record.sentiment,
            TRUE as was_cached;
    ELSE
        -- Create new cache entry
        INSERT INTO news_cache (symbol, news_date, news_events, sentiment)
        VALUES (p_symbol, p_news_date, p_news_events, p_sentiment)
        RETURNING * INTO new_record;
        
        -- Return new data
        RETURN QUERY SELECT 
            new_record.id,
            new_record.news_events,
            new_record.sentiment,
            FALSE as was_cached;
    END IF;
END;
$$;


ALTER FUNCTION public.get_or_create_news_cache(p_symbol character varying, p_news_date date, p_news_events jsonb, p_sentiment character varying) OWNER TO trader;

--
-- Name: log_strategy_classification(); Type: FUNCTION; Schema: public; Owner: trader
--

CREATE FUNCTION public.log_strategy_classification() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Only log if strategy actually changed or if it's a new assignment
    IF (OLD.strategy IS DISTINCT FROM NEW.strategy) OR 
       (OLD.strategy IS NULL AND NEW.strategy IS NOT NULL) THEN
        
        INSERT INTO strategy_classification_history (
            trade_id,
            user_id,
            previous_strategy,
            new_strategy,
            classification_method,
            confidence_score,
            classification_metadata,
            is_manual_override
        ) VALUES (
            NEW.id,
            NEW.user_id,
            OLD.strategy,
            NEW.strategy,
            COALESCE(NEW.classification_method, 'manual'), -- Default to 'manual' if null
            NEW.strategy_confidence,
            NEW.classification_metadata,
            COALESCE(NEW.manual_override, true) -- Default to true if null (manual edit)
        );
    END IF;
    
    RETURN NEW;
END;
$$;


ALTER FUNCTION public.log_strategy_classification() OWNER TO trader;

