-- Name: FUNCTION validate_cusip_ticker_uniqueness(); Type: COMMENT; Schema: public; Owner: trader
--

COMMENT ON FUNCTION public.validate_cusip_ticker_uniqueness() IS 'Prevents duplicate ticker symbols from being mapped to different CUSIPs globally';


