--
-- Name: active_alerts_with_prices; Type: VIEW; Schema: public; Owner: trader
--

CREATE VIEW public.active_alerts_with_prices AS
 SELECT pa.id,
    pa.user_id,
    pa.symbol,
    pa.alert_type,
    pa.target_price,
    pa.change_percent,
    pa.current_price AS alert_creation_price,
    pa.email_enabled,
    pa.browser_enabled,
    pa.repeat_enabled,
    pa.created_at,
    pm.current_price,
    pm.percent_change,
    pm.last_updated AS price_last_updated,
    u.email,
    us.email_notifications AS user_email_enabled
   FROM (((public.price_alerts pa
     JOIN public.users u ON ((pa.user_id = u.id)))
     LEFT JOIN public.user_settings us ON ((u.id = us.user_id)))
     LEFT JOIN public.price_monitoring pm ON (((pa.symbol)::text = (pm.symbol)::text)))
  WHERE ((pa.is_active = true) AND ((u.tier)::text = 'pro'::text));


