-- Name: loss_aversion_events_id_seq; Type: SEQUENCE; Schema: public; Owner: trader
--

CREATE SEQUENCE public.loss_aversion_events_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


ALTER TABLE public.loss_aversion_events_id_seq OWNER TO trader;

--
-- Name: loss_aversion_events_id_seq; Type: SEQUENCE OWNED BY; Schema: public; Owner: trader
--

ALTER SEQUENCE public.loss_aversion_events_id_seq OWNED BY public.loss_aversion_events.id;


--
-- Name: loss_aversion_summary; Type: VIEW; Schema: public; Owner: trader
--

CREATE VIEW public.loss_aversion_summary AS
 SELECT u.id AS user_id,
    u.username,
    la.hold_time_ratio,
    la.avg_winner_hold_time_minutes,
    la.avg_loser_hold_time_minutes,
    la.estimated_monthly_cost,
    (la.total_winning_trades + la.total_losing_trades) AS total_trades,
    la.analysis_end_date
   FROM (public.users u
     LEFT JOIN public.loss_aversion_events la ON (((u.id = la.user_id) AND (la.analysis_end_date = ( SELECT max(loss_aversion_events.analysis_end_date) AS max
           FROM public.loss_aversion_events
          WHERE (loss_aversion_events.user_id = u.id))))))
  WHERE (u.is_active = true);


