--
-- Name: personality_summary; Type: VIEW; Schema: public; Owner: trader
--

CREATE VIEW public.personality_summary AS
 SELECT u.id AS user_id,
    u.username,
    tpp.primary_personality,
    tpp.personality_confidence,
    tpp.avg_hold_time_minutes,
    tpp.avg_trade_frequency_per_day,
    tpp.personality_performance_score,
    tpp.optimal_strategy_adherence,
    pdt.drift_severity,
    pdt.personality_drift_score,
    ppc.return_percentile,
    ppc.peer_avg_return,
    tpp.analysis_end_date
   FROM (((public.users u
     LEFT JOIN public.trading_personality_profiles tpp ON (((u.id = tpp.user_id) AND (tpp.analysis_end_date = ( SELECT max(trading_personality_profiles.analysis_end_date) AS max
           FROM public.trading_personality_profiles
          WHERE (trading_personality_profiles.user_id = u.id))))))
     LEFT JOIN public.personality_drift_tracking pdt ON (((u.id = pdt.user_id) AND (pdt.analysis_date = ( SELECT max(personality_drift_tracking.analysis_date) AS max
           FROM public.personality_drift_tracking
          WHERE (personality_drift_tracking.user_id = u.id))))))
     LEFT JOIN public.personality_peer_comparison ppc ON (((u.id = ppc.user_id) AND (ppc.comparison_date = ( SELECT max(personality_peer_comparison.comparison_date) AS max
           FROM public.personality_peer_comparison
          WHERE (personality_peer_comparison.user_id = u.id))))))
  WHERE (u.is_active = true);


