    trade_date date NOT NULL,
    entry_time timestamp with time zone,
    exit_time timestamp with time zone,
    entry_price numeric(15,6) NOT NULL,
    exit_price numeric(15,6),
    quantity numeric(10,4) NOT NULL,
    side character varying(10) NOT NULL,
    commission numeric(15,6) DEFAULT 0,
    fees numeric(15,6) DEFAULT 0,
    pnl numeric(15,2),
    pnl_percent numeric(10,4),
    notes text,
    is_public boolean DEFAULT false,
    broker character varying(50),
    strategy character varying(100),
    setup character varying(100),
    tags text[],
    created_at timestamp with time zone DEFAULT CURRENT_TIMESTAMP,
    updated_at timestamp with time zone DEFAULT CURRENT_TIMESTAMP,
    executions jsonb,
    mae numeric(15,6) DEFAULT NULL::numeric,
    mfe numeric(15,6) DEFAULT NULL::numeric,
    split_adjusted boolean DEFAULT false,
    original_quantity numeric(15,4),
    original_entry_price numeric(15,4),
    original_exit_price numeric(15,4),
    strategy_confidence numeric(5,2) DEFAULT NULL::numeric,
    classification_method character varying(50) DEFAULT NULL::character varying,
    classification_metadata jsonb,
    manual_override boolean DEFAULT false,
    round_trip_id uuid,
    news_events jsonb DEFAULT '[]'::jsonb,
    has_news boolean DEFAULT false,
    news_sentiment character varying(20),
    news_checked_at timestamp with time zone,
    confidence integer,
    enrichment_status character varying(20) DEFAULT 'pending'::character varying,
    enrichment_completed_at timestamp with time zone,
    CONSTRAINT trades_confidence_check CHECK (((confidence >= 1) AND (confidence <= 10))),
    CONSTRAINT trades_enrichment_status_check CHECK (((enrichment_status)::text = ANY ((ARRAY['pending'::character varying, 'processing'::character varying, 'completed'::character varying, 'failed'::character varying])::text[]))),
