--
-- Name: watchlist_summary; Type: VIEW; Schema: public; Owner: trader
--

CREATE VIEW public.watchlist_summary AS
 SELECT w.id,
    w.user_id,
    w.name,
    w.description,
    w.is_default,
    w.created_at,
    w.updated_at,
    count(wi.id) AS item_count,
    count(pa.id) AS alert_count
   FROM ((public.watchlists w
     LEFT JOIN public.watchlist_items wi ON ((w.id = wi.watchlist_id)))
     LEFT JOIN public.price_alerts pa ON (((w.user_id = pa.user_id) AND ((pa.symbol)::text IN ( SELECT watchlist_items.symbol
           FROM public.watchlist_items
          WHERE (watchlist_items.watchlist_id = w.id))) AND (pa.is_active = true))))
  GROUP BY w.id, w.user_id, w.name, w.description, w.is_default, w.created_at, w.updated_at;


